import React, { Component } from 'react';

class App extends React.Component {
    render() {
        <div className="task-list">
            <div className="task">
                <input type="checkbox" /> 
                <p>Task 1</p>
            </div>

            <div className="task">
                <input type="checkbox" /> 
                <p>Task 2</p>
            </div>

            <div className="task">
                <input type="checkbox" /> 
                <p>Task 3</p>
            </div>
        </div>
    }
}

export default App;
